function CardListItem(props) {
    return (
        <li>{props.item}</li>
    )
}

function ProjectCard(props)  {

    let listItems=[]
    props.items.forEach((listItem) => {
        listItems.push(<CardListItem item={listItem}></CardListItem>)
    });

    return (
        <div className="rounded-xl border-8 border-blue-800 px-16 pt-5">
            <h2 className="text-center text-3xl font-bold text-blue-800 underline underline-offset-4">{props.title}</h2>
            <div className="mx-auto mt-4 text-xl">
                <ul>
                    {listItems}
                </ul>
            </div>
        </div>
    )
}


export let ProjectPage = (props) => {
    let awesome = ["Hello", "World"]
    return (
        <div className="h-screen from-blue-800 to-purple-700 bg-gradient-to-r">
            <div className="lg:container mx-auto bg-white h-screen">
                <div className="p-10">
                    <h1 className="text-7xl font-bold text-purple-700 text-center">Projects</h1>
                    <div className="flex justify-center mt-40">
                        <ProjectCard title="This Website" items={awesome}></ProjectCard>
                    </div>
                </div>

            </div>
        </div>
    )
}
